script: |
  super -f text -I q5440.spq | sort > q5440.out

inputs:
  - name: q5440.spq
    data: |
      SELECT DISTINCT ( col0 ) + col0 * + col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( 34 * col1 * + ( + ( - - col0 ) ) * + col1 + 68 / 49 ) NOT BETWEEN col2 AND 88;
  - name: tab2

outputs:
  - name: q5440.out
    data: |
      2162
      4160
      5700
